
#number of triplets where n[a] == n[b]*2 == n[c]  a<b<c
from collections import defaultdict
from typing import List

class Solution:
    def specialTriplets(self, nums: List[int]) -> int:
        dic=defaultdict(int)
        dic2=defaultdict(int)
        res=0
        for num in nums:
            if num%2==0 and num//2 in dic2:
                res+=dic2[num//2]
            if num*2 in dic:
                dic2[num] += dic[num*2]
            dic[num]+=1
        res%=10**9+7            
        return res
    

